import { useContext, useState } from "react";
import { Context } from "./Context";

function UserLogin() {

    const [user, setUser] = useState("Guest");
    const { setOpenForm } = useContext(Context);
    const form = useState(Context);

    const openForm = () => {
        setOpenForm(true);
        console.log(form);
    }



    return (
        <>
            <div className="sidenavlogin">
                <p>Hi {user}!</p>
                <p>Welcome to Access Workspace</p>
                <p><button onClick={() => openForm()}>Login</button></p>
            </div>
        </>
    );
}

export default UserLogin;
